// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.27;

import {HyperAccountMinterUpgradable} from "./HyperAccountMinterUpgradable.sol";
import {IHyperAccountPermissioned} from "../../src/interfaces/IHyperAccountPermissioned.sol";

contract HyperAccountPermissionedMinter is IHyperAccountPermissioned, HyperAccountMinterUpgradable {
    // Errors
    error InsufficientAllowance(address who);

    /// @dev The storage slot at which HyperAccountPermissionedMinter storage starts, following the EIP-7201 standard.
    /// @dev Calculated as `keccak256(abi.encode(uint256(keccak256("hyperware.HyperAccountPermissionedMinter.storage")) - 1)) & ~bytes32(uint256(0xff))`.
    bytes32 private constant _HYPERACCOUNT_PERMISSIONED_MINTER_STORAGE =
        0x35bbe4873c895459ab4bda5f265f5e5fa65e4b915cbe8dc27adf6ea1fa3ba400;

    struct HyperAccountPermissionedMinterStorage {
        mapping(address => uint256) allowances;
    }

    function _getHyperAccountPermissionedMinterStorage()
        internal
        pure
        returns (HyperAccountPermissionedMinterStorage storage $)
    {
        assembly {
            $.slot := _HYPERACCOUNT_PERMISSIONED_MINTER_STORAGE
        }
    }

    constructor(address _hypermap) HyperAccountMinterUpgradable(_hypermap) {}

    function initialize() public initializer {
        __UUPSUpgradeable_init();
        __EIP712_init("HyperAccountPermissionedMinter", "1");
    }

    /// @notice Authorize a minter to mint a specific number of sub-entries
    function auth(address who, uint256 _allowance) external virtual onlyOperator {
        HyperAccountPermissionedMinterStorage storage $ = _getHyperAccountPermissionedMinterStorage();
        $.allowances[who] = _allowance;
    }

    function deauth(address who) external virtual onlyOperator {
        HyperAccountPermissionedMinterStorage storage $ = _getHyperAccountPermissionedMinterStorage();
        $.allowances[who] = 0;
    }

    function allowance(address who) external view returns (uint256) {
        HyperAccountPermissionedMinterStorage storage $ = _getHyperAccountPermissionedMinterStorage();
        return $.allowances[who];
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(HyperAccountMinterUpgradable)
        returns (bool)
    {
        return super.supportsInterface(interfaceId) || interfaceId == type(IHyperAccountPermissioned).interfaceId;
    }

    function _mint(address to, bytes calldata name, bytes calldata initialization, address implementation)
        internal
        virtual
        override
        returns (address tba)
    {
        HyperAccountPermissionedMinterStorage storage $ = _getHyperAccountPermissionedMinterStorage();

        if ($.allowances[msg.sender] < 1) {
            revert InsufficientAllowance(msg.sender);
        }
        $.allowances[msg.sender] -= 1;
        return _HYPERMAP.mint(to, name, initialization, implementation);
    }
}
